import React, { useState } from 'react';
import './Component'
function LoginForm() {
  const [isLogin, setIsLogin] = useState(true);

  const toggleForm = () => {
    setIsLogin(!isLogin);
  };

  return (
    <div className="body" style={{ background: isLogin ? '#ff4931' : '#e0b722' }}>
      <div className="veen">
        <div className="login-btn splits">
          <p>Already a user?</p>
          <button className={isLogin ? 'active' : ''} onClick={toggleForm}>Login</button>
        </div>
        <div className="rgstr-btn splits">
          <p>Don't have an account?</p>
          <button className={isLogin ? '' : 'active'} onClick={toggleForm}>Register</button>
        </div>
        <div className="wrapper">
          <form id={isLogin ? 'login' : 'register'} tabIndex={isLogin ? '500' : '502'}>
            <h3>{isLogin ? 'Login' : 'Register'}</h3>
            {!isLogin && (
              <div className="name">
                <input type="text" name="" />
                <label>Full Name</label>
              </div>
            )}
            <div className="mail">
              <input type="mail" name="" />
              <label>{isLogin ? 'Mail or Username' : 'Mail'}</label>
            </div>
            {!isLogin && (
              <div className="uid">
                <input type="text" name="" />
                <label>User Name</label>
              </div>
            )}
            <div className="passwd">
              <input type="password" name="" />
              <label>Password</label>
            </div>
            <div className="submit">
              <button className="dark">{isLogin ? 'Login' : 'Register'}</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
export default LoginForm;
